function() {
  var purchase = {{Purchase - all Data}};

  switch({{[Customize] Purchase Value Tracking Type}}) {

    case 'net':
      return purchase.subvalue - purchase.productTax;
    case 'netWithShipping':
      return purchase.value - purchase.tax;
    case 'gross':
      return purchase.subvalue;
    case 'grossWithShipping':
      return purchase.value;

  }

}

function() {
  if ({{[Customize] Also Track Purchase when it's not first time access (Test mode)}}) {
    return true;
  }
  return {{Purchase - Is first time accessed}};
}

